export interface AddressModel {
  buildingName?: string
  buildingNumber?: string
  line1?: string
  line2?: string
  line3?: string
  line4?: string
  postcode?: string
  country?: string
  geolocation?: GeolocationModel
}

export interface GeolocationModel {
  latitude?: number
  longitude?: number
}

export const combineAddress = (address: AddressModel | undefined): string => {
  let addressCombined = ''

  if (!address) {
    return 'Unknown'
  }

  if (address.buildingNumber) {
    addressCombined = addressCombined.concat(`${address.buildingNumber}`)
  }

  if (address.buildingName) {
    addressCombined = addressCombined.concat(` ${address.buildingName}`)
  }

  if (address.line1) {
    addressCombined = addressCombined.concat(` ${address.line1}`)
  }

  if (address.line2) {
    addressCombined = addressCombined.concat(` ${address.line2}`)
  }

  if (address.line3) {
    addressCombined = addressCombined.concat(` ${address.line3}`)
  }

  if (address.line4) {
    addressCombined = addressCombined.concat(` ${address.line4}`)
  }

  if (address.postcode) {
    addressCombined = addressCombined.concat(` ${address.postcode}`)
  }

  if (address.country) {
    addressCombined = addressCombined.concat(` ${address.country}`)
  }

  if (!addressCombined) return 'Unknown'

  return addressCombined
}

export const combineName = (title?: string, forename?: string, surname?: string): string => {
  let nameCombined = ''

  if (title) {
    nameCombined = nameCombined.concat(`${title}`)
  }

  if (forename) {
    nameCombined = nameCombined.concat(` ${forename}`)
  }

  if (surname) {
    nameCombined = nameCombined.concat(` ${surname}`)
  }

  if (!nameCombined) return 'Unknown'

  return nameCombined
}

import { PersistentNotification } from '@reapit/elements'
import { Component, ErrorInfo, PropsWithChildren } from 'react'

export interface ErrorState {
  hasFailed: boolean
}

export class ErrorBoundary<T> extends Component<T & PropsWithChildren> {
  state = {
    hasFailed: false,
  }

  constructor(props: T & PropsWithChildren) {
    super(props)
  }

  static getDerivedStateFromError() {
    return {
      hasFailed: true,
    }
  }

  componentDidCatch(error: Error, info: ErrorInfo) {
    console.error('ERROR BOUNDARY CAUGHT', error.message, info)
  }

  render() {
    if (this.state.hasFailed) {
      return (
        <PersistentNotification isFullWidth isExpanded isInline intent="danger">
          Something went wrong here, try refreshing your page.
        </PersistentNotification>
      )
    }

    return <>{this.props.children}</>
  }
}

